const keyboard = [
    {
        id: 1,
        title: 'key1',
        image: 123,
        info: 'xxx',
        name: 'key1'
    },
    {
        id: 2,
        name: 'key2',
    },
    {
        id: 3,
        name: 'key3'
    }
];
const Mouse = [
    {
        id: 1,
        name: 'm1',
    },
    {
        id: 1,
        name: 'm2',
    },
    {
        id: 1,
        name: 'm3',
    },
]
export { keyboard, Mouse };
// console.log(keyboard[0].name, 'test');
